import React from 'react';
import {
  Drawer,
  List,
  ListItem,
  Button,
  Divider,
} from '@material-ui/core';
import { makeStyles } from '@material-ui/core/styles';

const useStyes = makeStyles((theme) => {
});

export default function AppDrawer({ isOpen }) {
  const classes = useStyles();

  return (
    <Drawer
      anchor='left'
      open={isOpen}
      transitionDuration={{
        enter: 1000,
        exit: 1000,
      }}
    >
      <List>
        <ListItem>
          Home
        </ListItem>
      </List>
    </Drawer>
  );
}
